import { useState } from "react";

function UpdateUser() {
  const [updateParams, setUpdateParams] = useState("");

  function updateUser() {
    fetch("/update", {
      method: "PUT",
      headers: {
        "Content-type": "application/json",
      },
      body: JSON.stringify({
        username: `"${updateParams}"`,
      }),
    });
  }

  return (
    <div>
      <form name="username" onSubmit={updateUser}>
        <input onChange={(e) => setUpdateParams(e.target.value)}></input>
        <button>Update username</button>
      </form>
    </div>
  );
}
export default UpdateUser;
